import React from 'react';
import { Container } from 'react-bootstrap';

function ImgContainer({ usedIds, getSrc, getPhotographer }) {
    return (
        <Container fluid>
            <div className='d-flex flex-wrap justify-content-center box-container'>
                {usedIds.map(index => {
                    return (
                        <div className='box' key={index}>
                            <img className='img-fluid' alt='random image' src={getSrc(index, 'medium')} ></img>
                            <div>
                            <a href={getSrc(index, 'original')} target='_blank'>Link</a>
                            <p>{getPhotographer(index)}</p>
                            </div>
                        </div>
                    )
                })}
            </div>
        </Container>
    );
};

export default ImgContainer;
